import React from 'react';

export default function Services (){
    return (
        <div id="services" className='services'>
            <h4>Services Provided:</h4>
            <ul>
                <li>Boarding</li>
                <li>Daycare</li>
                <li>Walking</li>
                <li>Training</li>
                <li>Grooming</li>
            </ul>
        </div>
    )
}
